INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("キャル", "2030/12/17 14:59:59", 1, 0, 0.0, 7001, -363.0, 7, 1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 0.0, 0, 106001, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("コッコロ", "2030/12/17 14:59:59", 1, 0, 0.0, 7002, -363.0, 7, 1, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 0.0, 0, 105901, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("ペコリーヌ", "2030/12/17 14:59:59", 1, 0, 0.0, 7003, -363.0, 7, 1, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 0.0, 0, 105801, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("キャル", "2030/12/17 14:59:59", 1, 0, 0.0, 10001, -363.0, 10, 1, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 0.0, 0, 106001, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("コッコロ", "2030/12/17 14:59:59", 1, 0, 0.0, 10002, -363.0, 10, 1, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 0.0, 0, 105901, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("ペコリーヌ", "2030/12/17 14:59:59", 1, 0, 0.0, 10003, -363.0, 10, 1, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 0.0, 0, 105801, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("ペコリーヌ", "2030/12/17 14:59:59", 1, 0, 0.0, 12001, -416.5, 12, 1, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 0.0, 0, 105801, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("キャル", "2030/12/17 14:59:59", 1, 0, 0.0, 13001, -363.0, 13, 1, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 0.0, 0, 106001, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("コッコロ", "2030/12/17 14:59:59", 1, 0, 0.0, 13002, -363.0, 13, 1, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 0.0, 0, 105901, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("ペコリーヌ", "2030/12/17 14:59:59", 1, 0, 0.0, 13003, -363.0, 13, 1, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 0.0, 0, 105801, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("キャル", "2030/12/17 14:59:59", 1, 0, 0.0, 14001, -363.0, 14, 1, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 0.0, 0, 106001, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("コッコロ", "2030/12/17 14:59:59", 1, 0, 0.0, 14002, -363.0, 14, 1, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 0.0, 0, 105901, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("ペコリーヌ", "2030/12/17 14:59:59", 1, 0, 0.0, 14003, -363.0, 14, 1, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 0.0, 0, 105801, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("コッコロ", "2030/12/17 14:59:59", 1, 0, 0.0, 15001, -470.0, 15, 1, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 0.0, 0, 105901, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("キャル", "2030/12/17 14:59:59", 1, 0, 0.0, 16001, -363.0, 16, 1, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 0.0, 0, 106001, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("コッコロ", "2030/12/17 14:59:59", 1, 0, 0.0, 16002, -363.0, 16, 1, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 0.0, 0, 105901, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("ペコリーヌ", "2030/12/17 14:59:59", 1, 0, 0.0, 16003, -363.0, 16, 1, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 0.0, 0, 105801, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("コッコロ", "2030/12/17 14:59:59", 1, 0, 0.0, 17002, -363.0, 17, 1, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 0.0, 0, 105901, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("キャル", "2030/12/17 14:59:59", 1, 0, 0.0, 17004, -363.0, 25, 1, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 0.0, 0, 106001, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("コッコロ", "2030/12/17 14:59:59", 1, 0, 0.0, 17005, -363.0, 25, 1, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 0.0, 0, 105901, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("ペコリーヌ", "2030/12/17 14:59:59", 1, 0, 0.0, 17006, -363.0, 25, 1, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 0.0, 0, 105801, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("カリン", "2030/12/17 14:59:59", 1, 0, 0.0, 18001, -363.0, 18, 1, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 0.0, 0, 190801, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("カリン", "2030/12/17 14:59:59", 2, 0, 0.0, 18002, -363.0, 18, 1, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 0.0, 0, 190801, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("カリン", "2030/12/17 14:59:59", 3, 0, 0.0, 19001, -470.0, 19, 1, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 0.0, 0, 190801, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("カリン", "2030/12/17 14:59:59", 4, 0, 0.0, 19002, -470.0, 19, 1, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 0.0, 0, 190801, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("カリン", "2030/12/17 14:59:59", 5, 0, 0.0, 20001, -470.0, 20, 1, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 0.0, 0, 190801, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("カリン", "2030/12/17 14:59:59", 6, 0, 0.0, 20002, -470.0, 20, 1, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 0.0, 0, 190801, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("キャル", "2030/12/17 14:59:59", 1, 0, 0.0, 21001, -363.0, 21, 1, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 0.0, 0, 106001, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("コッコロ", "2030/12/17 14:59:59", 1, 0, 0.0, 21002, -363.0, 21, 1, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 0.0, 0, 105901, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("ペコリーヌ", "2030/12/17 14:59:59", 1, 0, 0.0, 21003, -363.0, 21, 1, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 0.0, 0, 105801, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("カリン", "2030/12/17 14:59:59", 1, 0, 0.0, 22001, -430.0, 22, 1, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 0.0, 0, 190801, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("カリン", "2030/12/17 14:59:59", 2, 0, 0.0, 22002, -430.0, 22, 1, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 0.0, 0, 190801, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("カリン", "2030/12/17 14:59:59", 3, 0, 0.0, 23001, -430.0, 23, 1, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 0.0, 0, 190801, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("カリン", "2030/12/17 14:59:59", 4, 0, 0.0, 23002, -430.0, 23, 1, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 0.0, 0, 190801, 1, "2015/12/17 15:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("エリコ（バレンタイン）", "2030/12/17 14:59:59", 1, 0, 8.0, 24001, -385.0, 24, 1, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 4.08, 10011, 109001, 2, "2019/01/31 12:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("エリコ（バレンタイン）", "2030/12/17 14:59:59", 2, 0, 8.0, 24002, -385.0, 24, 1, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 5.0, 10011, 109001, 2, "2019/01/31 12:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("エリコ（バレンタイン）", "2030/12/17 14:59:59", 3, 0, 8.0, 24003, -385.0, 24, 1, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 10.11, 10011, 109001, 2, "2019/01/31 12:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("エリコ（バレンタイン）", "2030/12/17 14:59:59", 4, 0, 8.0, 24004, -385.0, 24, 1, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 4.0, 10011, 109001, 2, "2019/01/31 12:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("エリコ（バレンタイン）", "2030/12/17 14:59:59", 5, 0, 8.0, 24005, -385.0, 24, 1, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 6.0, 10011, 109001, 2, "2019/01/31 12:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("エリコ（バレンタイン）", "2030/12/17 14:59:59", 6, 0, 0.0, 24006, 0.0, 24, 1, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0.0, 10011, 109002, 1, "2019/01/31 12:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("エリコ（バレンタイン）", "2030/12/17 14:59:59", 7, 0, 0.0, 24007, 0.0, 24, 1, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0.0, 10011, 109002, 1, "2019/01/31 12:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("エリコ（バレンタイン）", "2030/12/17 14:59:59", 8, 0, 0.0, 24008, 0.0, 24, 1, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0.0, 10011, 109002, 1, "2019/01/31 12:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("エリコ（バレンタイン）", "2030/12/17 14:59:59", 9, 0, 0.0, 24009, 0.0, 24, 1, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0.0, 10011, 109002, 1, "2019/01/31 12:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("エリコ（バレンタイン）", "2030/12/17 14:59:59", 10, 0, 0.0, 24010, 0.0, 24, 1, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0.0, 10011, 109002, 1, "2019/01/31 12:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("シズル（バレンタイン）", "2030/12/17 14:59:59", 1, 0, 8.0, 24011, -385.0, 24, 1, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 2.12, 10011, 109101, 2, "2019/01/31 12:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("シズル（バレンタイン）", "2030/12/17 14:59:59", 2, 0, 8.0, 24012, -385.0, 24, 5, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 4.19, 10011, 109101, 2, "2019/01/31 12:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("シズル（バレンタイン）", "2030/12/17 14:59:59", 3, 0, 8.0, 24013, -385.0, 24, 2, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 2.3, 10011, 109101, 4, "2019/01/31 12:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("シズル（バレンタイン）", "2030/12/17 14:59:59", 4, 0, 0.0, 24014, 0.0, 24, 1, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 0.0, 10011, 109102, 1, "2019/01/31 12:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("シズル（バレンタイン）", "2030/12/17 14:59:59", 5, 0, 8.0, 24015, -385.0, 24, 5, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 5.23, 10011, 109101, 2, "2019/01/31 12:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("シズル（バレンタイン）", "2030/12/17 14:59:59", 6, 0, 0.0, 24016, 0.0, 24, 1, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0.0, 10011, 109102, 1, "2019/01/31 12:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("シズル（バレンタイン）", "2030/12/17 14:59:59", 7, 0, 8.0, 24017, -385.0, 24, 1, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 5.01, 10011, 109101, 2, "2019/01/31 12:00:00");
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES ("シズル（バレンタイン）", "2030/12/17 14:59:59", 8, 0, 0.0, 24018, 0.0, 24, 1, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 0.0, 10011, 109102, 1, "2019/01/31 12:00:00");
